import React from 'react';

import { useState, useEffect } from 'react';

import LiftConsoleButton from './lift_console_button';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

function submit_request(to_floor, from_floor)
{
    console.log("ERROR");
    fetch('http://localhost:8000/api/lift/request/', {
    method: 'POST',
    headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
    },
    body: JSON.stringify({
        from_floor: from_floor,
        to_floor: to_floor,
    })
    }).then((res) => {
        return res.json();
    }).then((data) => {

    });
}

const Fetch = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('http://127.0.0.1:8000//api/lift/config/')
      .then((res) => {
        console.log(res)
        return res.json();
      })
      .then((data) => {
        let avaliable_floors = [];
        for (let lift of data["lifts"]){
            if (lift["serviced_floors"].includes(floor)) {
                avaliable_floors = avaliable_floors.concat(lift["serviced_floors"].filter(item2 =>
                    !avaliable_floors.some(item1 => item1 === item2)
                ));
            }
        }
        console.log(avaliable_floors);
        setData(avaliable_floors);
      });
  }, []);
  return ( <div>
            <Card style={{ width: '30%' }}>
                <Card.Body>
                    <Card.Title>Lift Console</Card.Title>
                        {data.map((floor) => ( <Button variant="primary" onClick={() => submit_request(floor, 0)}>{floor}</Button>))}
                </Card.Body>
            </Card>
        </div>
        )
};
export default Fetch;
